  current_panel_index = function() {
    return Math.min(Math.round($(window).scrollTop() / $(window).height()), max_panels - 1);
  };

  correct_panel_height = function() {
    if (can_slide()) {
      jQuery("body").css({
        width: $(window).width(),
        height: $(window).height()
      });
      $(".panel").css({
        height: $(window).height()
      }).find(".left-bg, .right-bg, .content").css({
        height: $(window).height()
      });
      return $(".jcarousel-wrapper").css({
        width: $(window).width()
      });
    } else {
      return jQuery("body").css({
        width: $(window).width()
      });
    }
  };

  toggle_transition = function($button, bottom1, duration, bottom2) {
    $button.toggleClass('transition');
    $button.stop().animate({
      bottom: bottom1
    }, duration, 'easeInOutQuad', function() {
      $button.toggleClass('transition');
      $button.removeAttr('style');
      return $button.toggleClass('active');
    });
    $('.navigation-wrapper').stop().animate({
      bottom: bottom2
    }, 600, 'easeInOutQuad');
  };

  toggle_navigation = function() {
    var $button;
    $button = $(".footer-container .btn-shownav");
    $(".navigation-wrapper").toggleClass("active");
    if ($button.hasClass('active')) {
      toggle_transition($button, '-0.3em', 520, -500);
      $("footer .footer-container .left-footer .icon").fadeIn({
        duration: 600,
        easing: "easeInOutQuad"
      });
    } else {
      toggle_transition($button, 475, 600, 15);
      $('footer .footer-container .left-footer .icon').fadeOut({
        duration: 600,
        easing: 'easeInOutQuad'
      });
    }
    return false;
  };

  scroll_to_panel = function(panel_no) {
    if (!(panel_no >= 0 && panel_no < max_panels)) {
      return;
    }
    if (!allow_scroll) {
      return;
    }
    allow_scroll = false;
    resize_handle = setTimeout(function() {
      return allow_scroll = true;
    }, 350);
    if ($('body').hasClass('transition')) {
      jQuery("html, body").stop(true, false);
    } else {
      $("body").addClass("transition");
    }
    jQuery("html, body").stop().animate({
      scrollTop: $(".panel").eq(panel_no).position().top
    }, {
      duration: 900,
      easing: "easeOutCirc",
      complete: function() {
        $("body").removeClass("transition");
        if ($('.footer-container h1').hasClass('active')) {
          toggle_navigation();
        }
      }
    });
  };

  $(document).bind("mousewheel", function(e, delta) {
    var panel_delta, panel_no;
    if ($('.mfp-container').is(':visible')) {
      return true;
    }
    if (can_slide()) {
      e.preventDefault();
      panel_no = current_panel_index();
      panel_delta = (delta < 0 ? 1 : -1);
      return scroll_to_panel(panel_no + panel_delta);
    }
  });

